import React, { Component } from 'react';



class Image extends Component {
    callImage = () => {
        const img = this.props.imageDetails.html;
        return <img src={img} alt={this.props.imageDetails.id} />
        console.log(img)
    }

    render() {

        return (
            <div className="card" >
                {this.props.imageDetails.id}
                {this.callImage}

            </div>
        );
    }
}




export default Image;
